function addButton() {
    const labelButton = document.createElement('button');
    labelButton.textContent = 'Label';
    labelButton.classList.add("nucleus-button");
    labelButton.classList.add("nucleus-button--secondary");
    labelButton.classList.add("app-icon-btn--text");
    labelButton.classList.add("hint--rounded");
    labelButton.classList.add("hint--bottom");
    labelButton.classList.add("ember-view");
    labelButton.setAttribute("aria-label", "Print to Label Printer");
    document.getElementsByClassName("page-actions__left")[0].appendChild(labelButton);
    labelButton.addEventListener('click', () => {
        generateLabel();
    });
    const descText = document.createTextNode(' Description');
    const chkLabel = document.createElement('label');
    const chkBox = document.createElement('input');
    chkBox.setAttribute("type", "checkbox");
    chkBox.checked = true;
    chkBox.setAttribute("id", "includeDesc");
    document.getElementsByClassName("page-actions__left")[0].appendChild(chkLabel);
    chkLabel.appendChild(chkBox);
    chkLabel.appendChild(descText);
}
function formatDate(inputDate) {
    var date = new Date(inputDate);
    var day = date.getDate();
    var month = date.getMonth() + 1;
    var year = date.getFullYear();
    if (day < 10) {
        day = '0' + day;
    }
    if (month < 10) {
        month = '0' + month;
    }
    var formattedDate = day + '/' + month + '/' + year;
    return formattedDate;
}
function generateLabel() {
    const descChecked = document.getElementById("includeDesc").checked;
    var count = prompt("How many labels?");
    const unparsedTitle = document.title.split(" :")[0];
    const parsedTicketNumber = unparsedTitle.split('#')[1].split(']')[0];
    const parsedTitle = unparsedTitle.split("] ")[1];
    const parsedDate = formatDate(document.getElementsByClassName("timeago-units")[0].textContent.split("(")[1].split(" at")[0]);
    const parsedName = document.querySelector("[data-test-id=user-name]").textContent.split("\n")[1].trimStart();
    const parsedDesc = document.getElementById("ticket_original_request").textContent;
    for (let i = 0; i < count; i++) {
        document.open();
        document.write("<div style=\"line-height: 1.5;\">");
        document.write("<p style=\"background-repeat: no-repeat; background-size: 30%; background-position: right bottom; font-family: Verdana, sans-serif; font-size: 12px; background-image: " + imageBlob + ";\">");
        document.write("No. " + parsedTicketNumber + ": " + parsedName + "<br>");
        document.write(parsedTitle + "<br>");
        document.write(parsedDate + "<br>");
        if (descChecked) {
            document.write("<font size=\"-4\">" + parsedDesc + "</font>" + "<br>");
        }
        document.write((i + 1).toString() + " of " + count.toString() + "<br>");
        document.write("</p>");
        document.write("</div>")
        window.print();
    }

    location.reload();
}
function waitForElement(selector, callback) {
    const observer = new MutationObserver(function (mutations) {
        mutations.forEach(function (mutation) {
            const nodesAdded = Array.from(mutation.addedNodes);
            nodesAdded.forEach(function (node) {
                if (node.nodeType === 1 && node.matches(selector)) {
                    observer.disconnect();
                    callback();
                }
            });
        });
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });
}
